  true,\n\t\"url\": null,\n\t\"notes\": \"Certified models meet all ENERGY STAR requirements
  as listed in the Version 5.0 ENERGY STAR Program Requirements for Air Source Heat
  Pump and Central Air Conditioner Equipment that are effective as of September 15,
  2015. A detailed listing of key efficiency criteria are available at http://www.energystar.gov/index.cfm?c=airsrc_heat.pr_crit_as_heat_pumps
  Listed products have been submitted to EPA by ENERGY STAR partners that do not participate
  in the AHRI certification program. EPA will continue to update this list with products
  that are certified by EPA-recognized certification bodies other than AHRI. The majority
  of ENERGY STAR products, certified by AHRI, can be found on the CEE/AHRI Verified
  Directory at http://www.ceedirectory.org/\",\n\t\"license_title\": \"Other License
